import React, { PureComponent } from 'react';
import './../css/test.css'
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer,Brush } from 'recharts';
const data = [
    {
        name: '2078',
        Projects: 18,
    },
    {
        name: '2079',
        Projects: 32,
    },
    {
        name: '2080',
        Projects: 120,
    },
    {
        name: '2081',
        Projects: 80,
    },
    {
        name: '2082',
        Projects: 3,
    },
    {
        name: '2083',
        Projects: 35,
    },
    {
        name: '2084',
        Projects: 45,
    },
];

export default class Test extends PureComponent {
    render() {
        return (
            <div id="test">
                <ResponsiveContainer width="100%" height="100%">
                    <LineChart
                        width={500}
                        height={300}
                        data={data}
                        margin={{
                            top: 5,
                            right: 30,
                            left: 20,
                            bottom: 5,
                        }}
                    >
                        <CartesianGrid strokeDasharray="3 3" />
                        <XAxis dataKey="name" />
                        <YAxis />
                        <Tooltip />
                        <Legend />
                        <Line type="monotone" dataKey="Projects" stroke="#8884d8" activeDot={{ r: 8 }} />
                    </LineChart>
                </ResponsiveContainer>
            </div>
        );
    }
}
